// src/components/AdminDashboard.js
import React from 'react';
import { useState, useEffect } from 'react';
import axios from 'axios';
import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

const AdminDashboard = () => {
  const [analytics, setAnalytics] = useState({
    pendingTasks: 0,
    scheduledTasks: 0,
    completedTasks: 0,
    totalTasks: 0,
    tasks: []
  });

  useEffect(() => {
    // Replace with your API endpoint
    axios.get('http://localhost:5000/api/analytics')
      .then(response => setAnalytics(response.data))
      .catch(error => console.error('Error fetching analytics data:', error));
  }, []);

  return (
    <div className="p-8">
      <h1 className="text-4xl font-bold mb-8">Admin Dashboard</h1>

      <div className="grid grid-cols-2 gap-8 mb-8">
        <div className="flex flex-col items-center">
          <CircularProgressbar
            value={(analytics.pendingTasks / analytics.totalTasks) * 100}
            text={`${analytics.pendingTasks}`}
            styles={buildStyles({
              pathColor: '#f87171',
              textColor: '#f87171',
              trailColor: '#374151',
            })}
          />
          <h2 className="mt-4 text-xl">Pending Tasks</h2>
        </div>
        <div className="flex flex-col items-center">
          <CircularProgressbar
            value={(analytics.scheduledTasks / analytics.totalTasks) * 100}
            text={`${analytics.scheduledTasks}`}
            styles={buildStyles({
              pathColor: '#60a5fa',
              textColor: '#60a5fa',
              trailColor: '#374151',
            })}
          />
          <h2 className="mt-4 text-xl">Scheduled Tasks</h2>
        </div>
        <div className="flex flex-col items-center">
          <CircularProgressbar
            value={(analytics.completedTasks / analytics.totalTasks) * 100}
            text={`${analytics.completedTasks}`}
            styles={buildStyles({
              pathColor: '#34d399',
              textColor: '#34d399',
              trailColor: '#374151',
            })}
          />
          <h2 className="mt-4 text-xl">Completed Tasks</h2>
        </div>
        <div className="flex flex-col items-center">
          <CircularProgressbar
            value={100} // Full circle as this represents total number of tasks
            text={`${analytics.totalTasks}`}
            styles={buildStyles({
              pathColor: '#fbbf24',
              textColor: '#fbbf24',
              trailColor: '#374151',
            })}
          />
          <h2 className="mt-4 text-xl">Total Tasks</h2>
        </div>
      </div>

      <h2 className="text-2xl font-semibold mb-4">Tasks List</h2>
      <table className="min-w-full bg-gray-800 text-gray-300">
        <thead>
          <tr>
            <th className="py-2 px-4 border-b">Task Name</th>
            <th className="py-2 px-4 border-b">Description</th>
            <th className="py-2 px-4 border-b">Status</th>
            <th className="py-2 px-4 border-b">Schedule</th>
            <th className="py-2 px-4 border-b">Assigned User</th>
            <th className="py-2 px-4 border-b">Email</th>
          </tr>
        </thead>
        <tbody>
          {analytics.tasks.map((task, index) => (
            <tr key={index}>
              <td className="py-2 px-4 border-b">{task.task_name}</td>
              <td className="py-2 px-4 border-b">{task.task_description}</td>
              <td className="py-2 px-4 border-b">{task.task_status}</td>
              <td className="py-2 px-4 border-b">{task.task_schedule}</td>
              <td className="py-2 px-4 border-b">{task.assigned_user_name}</td>
              <td className="py-2 px-4 border-b">{task.assigned_task_email}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <button className="bg-teal-600 hover:bg-teal-700 text-gray-100 font-bold py-2 px-4 rounded-full focus:outline-none focus:shadow-outline mt-8">
        + Add Task
      </button>
    </div>
  );
};

export default AdminDashboard;
